import React, { useState, useEffect} from 'react';
import './App.css';
import Objective from "./components/Card/Objective.js";



function App() {
    const newObj={
        "title": "Objective 3",
        "id": "3",
        "task": [{
            "id": "3",
            "title": "task1",
            "specific": "sasdad",
            "measurable": "ad",
            "achievable": "ads",
            "relevant": "asd",
            "status": "asd"
        }, {
            "id": "4",
            "title": "task2",
            "specific": "sasdad",
            "measurable": "ad",
            "achievable": "ads",
            "relevant": "asd",
            "status": "asd"
        }]
    }

    const [state, setState] = useState({
        "objective": [
            {
                "title": "Objective 1",
                "id": "1",
                "task": [
                    {
                        "id": "3",
                        "title": "task1",
                        "specific": "sasdad",
                        "measurable": "ad",
                        "achievable": "ads",
                        "relevant": "asd",
                        "status": "asd"
                    },
                    {
                        "id": "4",
                        "title": "task2",
                        "specific": "sasdad",
                        "measurable": "ad",
                        "achievable": "ads",
                        "relevant": "asd",
                        "status": "asd"
                    }
                ]
            },
            {
                "title": "Objective 2",
                "id": "2",
                "task": [
                    {
                        "id": "5",
                        "title": "task12",
                        "specific": "sasdad",
                        "measurable": "ad",
                        "achievable": "ads",
                        "relevant": "asd",
                        "status": "asd"
                    },
                    {
                        "id": "6",
                        "title": "task22",
                        "specific": "sasdad",
                        "measurable": "ad",
                        "achievable": "ads",
                        "relevant": "asd",
                        "status": "asd"
                    }
                ]
            }
        ]
    })

    useEffect(() => {
        let newObjective
        if (state.objective) {
            newObjective = [...state.objective]; // So we dont mutate state
            newObjective.push({objective: newObj});
        }

        console.log(newObjective) // Test if it is updated correctly

        // Set the state with the new array
        setState({...state, data: { objective: newObjective }});
    }, [state.objective]);

    const handleClick = () =>
        setState({
            ...state, data:{objective:[newObj]}
        })
    const {objective} = state

    return (
        <div>
            <p>Today I am {console.log(objective.length)} Years of Age</p>
            <div className="content">{ objective.map((objective, index) =>
                <Objective key={objective.id} objective={objective}/>)}
            </div>
            {console.log("two",JSON.stringify(state))}
            <div>
                <button onClick={handleClick}>Get older!</button>
            </div>

        </div>
    )
}
export default App;
